import React, { useState, useEffect } from 'react';
import { MapPin, Clock, Heart, Phone } from 'lucide-react';

const WeddingInvitation = () => {
  const [confirmed, setConfirmed] = useState(false);

  const weddingDetails = {
    brideAndGroom: {
      bride: "Sarah",
      groom: "Michael",
      date: "August 15, 2025"
    },
    lyrics: "Love is patient, love is kind.\nIt does not envy, it does not boast,\nit is not proud.",
    ceremony: {
      time: "2:00 PM",
      location: "St. Patrick's Cathedral",
      address: "5th Avenue, New York, NY",
      mapsLink: "https://maps.google.com/?q=St+Patricks+Cathedral+NY"
    },
    reception: {
      time: "6:00 PM",
      location: "The Plaza Hotel",
      address: "768 5th Ave, New York, NY",
      mapsLink: "https://maps.google.com/?q=The+Plaza+Hotel+NY"
    },
    godparents: {
      bride: ["Jane & John Davis", "Mary & Robert Wilson"],
      groom: ["Elizabeth & James Brown", "Patricia & William Taylor"]
    },
    rsvpPhone: "+1 (555) 123-4567"
  };

  const CustomStyles = () => {
    useEffect(() => {
      const style = document.createElement('style');
      style.textContent = `
        @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300;400;500&display=swap');
        @import url('https://fonts.googleapis.com/css2?family=Alex+Brush&display=swap');
        
        .font-script {
          font-family: 'Alex Brush', cursive;
        }

        @keyframes fadeIn {
          from { opacity: 0; transform: translateY(10px); }
          to { opacity: 1; transform: translateY(0); }
        }

        @keyframes drawLine {
          from { width: 0; }
          to { width: 100%; }
        }

        .animate-fade-in {
          opacity: 0;
          animation: fadeIn 1.5s ease-out forwards;
        }

        .animate-draw-line {
          animation: drawLine 2s ease-out forwards;
        }

        .image-zoom {
          animation: zoomEffect 20s infinite alternate ease-in-out;
        }

        @keyframes zoomEffect {
          from { transform: scale(1); }
          to { transform: scale(1.1); }
        }

        .scroll-section {
          scroll-snap-align: start;
        }

        @keyframes float-1 {
          0%, 100% { transform: translate(0, 0) rotate(0deg); }
          25% { transform: translate(10px, -15px) rotate(5deg); }
          50% { transform: translate(-5px, -25px) rotate(-5deg); }
          75% { transform: translate(-15px, -15px) rotate(2deg); }
        }

        @keyframes float-2 {
          0%, 100% { transform: translate(0, 0) rotate(0deg); }
          33% { transform: translate(-15px, -20px) rotate(-3deg); }
          66% { transform: translate(10px, -30px) rotate(3deg); }
        }

        @keyframes float-3 {
          0%, 100% { transform: translate(0, 0) rotate(0deg); }
          50% { transform: translate(15px, -25px) rotate(5deg); }
        }

        .balloon-1 { animation: float-1 15s infinite ease-in-out; }
        .balloon-2 { animation: float-2 18s infinite ease-in-out; }
        .balloon-3 { animation: float-3 20s infinite ease-in-out; }
      `;
      document.head.appendChild(style);
      return () => document.head.removeChild(style);
    }, []);
    return null;
  };

  const Balloon = ({ className, size, color, style }) => (
    <div 
      className={`absolute ${className}`}
      style={style}
    >
      <svg width={size} height={size * 1.2} viewBox="0 0 24 28" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M12 0C7.58172 0 4 3.58172 4 8C4 12.4183 7.58172 16 12 16C16.4183 16 20 12.4183 20 8C20 3.58172 16.4183 0 12 0Z" fill={color}/>
        <path d="M12 16L10 28H14L12 16Z" fill={color}/>
      </svg>
    </div>
  );

  const FloatingBalloons = () => (
    <div className="fixed inset-0 pointer-events-none overflow-hidden">
      <Balloon 
        className="balloon-1 top-10 left-[10%]" 
        size={40} 
        color="rgba(255, 192, 203, 0.3)"
        style={{ animationDelay: '0s' }}
      />
      <Balloon 
        className="balloon-2 top-20 left-[30%]" 
        size={30} 
        color="rgba(255, 182, 193, 0.3)"
        style={{ animationDelay: '-5s' }}
      />
      <Balloon 
        className="balloon-3 top-15 left-[50%]" 
        size={35} 
        color="rgba(255, 192, 203, 0.3)"
        style={{ animationDelay: '-10s' }}
      />
      <Balloon 
        className="balloon-1 top-25 left-[70%]" 
        size={45} 
        color="rgba(255, 182, 193, 0.3)"
        style={{ animationDelay: '-7s' }}
      />
      <Balloon 
        className="balloon-2 top-12 left-[90%]" 
        size={38} 
        color="rgba(255, 192, 203, 0.3)"
        style={{ animationDelay: '-3s' }}
      />
    </div>
  );

  const Section = ({ children, className = "" }) => (
    <div className={`min-h-screen w-full flex flex-col items-center justify-center p-8 scroll-section ${className}`}>
      {children}
    </div>
  );

  return (
    <div className="font-['Raleway'] text-gray-800 overflow-x-hidden">
      <CustomStyles />
      <FloatingBalloons />
      
      {/* Hero Section */}
      <Section className="bg-white">
        {/* Rest of the code remains the same */}
      </Section>
    </div>
  );
};

export default WeddingInvitation;
